import os
import base64
import winreg
import ctypes

def refresh_cursors():
    """Force Windows to reload the cursor scheme without restarting."""
    SPI_SETCURSORS = 0x0057
    ctypes.windll.user32.SystemParametersInfoW(SPI_SETCURSORS, 0, None, 0)
    print("Cursor refreshed.")

# Base64 embedded cursor files
CURSOR_DATA = {
    "Arrow": """""",
    "Hand": """""",
    "AppStarting": """"""
}

CURSOR_FILENAMES = {
    "Arrow": "aero_arrow.cur",
    "Hand": "aero_link.cur",
    "AppStarting": "aero_working.ani"
}

def save_cursor_file(base64_data, save_path):
    """Decode base64 data and save it to the given path."""
    try:
        with open(save_path, "wb") as f:
            f.write(base64.b64decode(base64_data))
        print(f"Saved cursor file: {save_path}")
        return True, ""
    except Exception as e:
        return False, f"Error saving file {save_path}: {e}"

def update_registry(key_name, file_path):
    try:
        registry_key = winreg.OpenKey(
            winreg.HKEY_CURRENT_USER,
            r"Control Panel\Cursors",
            0,
            winreg.KEY_SET_VALUE
        )
        winreg.SetValueEx(registry_key, key_name, 0, winreg.REG_SZ, file_path)
        winreg.CloseKey(registry_key)
        print(f"Registry key '{key_name}' updated to: {file_path}")
        return True, ""
    except Exception as e:
        return False, f"Error updating registry for key '{key_name}': {e}"

def main():
    errors = []

    user_profile = os.environ.get("USERPROFILE")
    if not user_profile:
        print("Cannot determine user profile directory.")
        input("Enter to exit...")
        return

    cursors_dir = os.path.join(user_profile, "Documents", "Cursors")
    try:
        os.makedirs(cursors_dir, exist_ok=True)
    except Exception as e:
        print(f"Error creating directory {cursors_dir}: {e}")
        input("Enter to exit...")
        return

    # Save cursor files from embedded base64
    saved_files = {}
    for key, base64_data in CURSOR_DATA.items():
        file_path = os.path.join(cursors_dir, CURSOR_FILENAMES[key])
        success, msg = save_cursor_file(base64_data, file_path)
        if not success:
            errors.append(msg)
        else:
            saved_files[key] = file_path

    # Update registry
    for key, file_path in saved_files.items():
        success, msg = update_registry(key, file_path)
        if not success:
            errors.append(msg)

    # Output
    if errors:
        print("The following error(s) occurred:")
        for error in errors:
            print(" -", error)
    else:
        print("All cursors updated successfully.")
        refresh_cursors()

    #input("Enter to exit...")

if __name__ == "__main__":
    main()